ISLAMABAD, Jan 19 (APP):Pakistan Tehreek Insaf Senator Faisal Javed Khan Tuesday termed the protest being held by the Pakistan Democratic Movement (PDM) outside the ECP office another attempt to seek an NRO (National Reconciliation Ordinance) from the government.
Senator Faisal, in a tweet, said the opposition parties had not submitted details of foreign funding to the Election Commission of Pakistan (ECP), while the PTI had provided the record of 40,000 donors, besides audited accounts.
